import './sign-up.scss';

import React, { Component } from 'react'

export class SignUp extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             displayName: '',
             email: '',
             password: '',
             confirmPassword: ''
        }
    }
    
    render() {
        return (
            <div className='sign-up'>
                Sign up
            </div>
        )
    }
}

export default SignUp
